  6,\n\t\"tags\": [],\n\t\"title\": \"EPA Townetting CTD casts - Evaluating the ecological
  health of Puget Sound's pelagic foodweb\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  5,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-03-21T23:26:37.671083\",\n\t\"name\": \"epa-townetting-ctd-casts-evaluating-the-ecological-health-of-puget-sounds-pelagic-foodweb\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"To evaluate effects of human influence
  on the health of Puget Sound's pelagic ecosystems, we propose a sampling program
  across multiple oceanographic basins measuring key attributes of the pelagic foodweb.
  We will quantify seasonal abundance and composition of pelagic biota from lower
  trophic levels (e.g., bacteria and phytoplankton) to middle trophic levels (e.g.,
  zooplankton, small pelagic fishes, and jellyfish), as well as assess the individual
  condition of forage fish and juvenile salmon. nnThe goals of this program:nn1) Determine
  how foodweb endpoints vary across natural and anthropogenic gradients.nn2) Determine
  how these characteristics vary across Puget Sound.nn3) Evaluate a number of biological
  metrics for monitoring ecosystem health.nnThese outputs will improve our basic understanding
  of pelagic ecology in Puget Sound, better define what comprises a healthy pelagic
  ecosystem in Puget Sound, determine foodweb-relevant indicators that are sensitive
  to human influence, and help prioritize regional protection and restoration efforts.
  Work is conducted by NOAA personnel and contractors in collaboration with tribal
  partners (Squaxin, Port Gamble/S'Klallam), undergraduate research interns, and citizen
  volunteers.nnAccess database containing all conductivity/temperature/depth (CTD)
  casts.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
